import React from 'react';
import Navbar from "../navbar";
import styled from 'styled-components';
import Mainlanding from "./mainlanding";
import {AnimatePresence, motion} from 'framer-motion';

const HomeContainer = styled.div`
    height: 100vh;
    background-color: #EFE7E2;
`

function Home() {
    return (
            <HomeContainer>
                <Navbar/>
                <motion.div key="home" initial={{ y: 100, opacity: 0}} animate={{ scale: 1, translateY: -100, opacity: 1}} exit={{ translateY: 100, opacity: 0 }} transition={{ duration: .5 }}>
                    <Mainlanding/>
                </motion.div>
            </HomeContainer>
    );
}

export default Home;
